function SponsoredBills({ info }) {
    console.log('votevote:', votingInfo)
    return (
        <div>
            {votingInfo.map((bill, index) => (
                <tr key={`bill-${index}`}>
                    <td>{bill.introduce.Date}</td>
                </tr>
            ))};
        </div>
    );
}

export default SponsoredBills;
